import React, { Component } from 'react'
import SinglePhotoComponent from '../SinglePhotoComponent'

export default class PhotoList extends Component {
    constructor(){
        super()
        this.state = {
            images: []
        }
    }
    componentDidMount(){
        fetch('https://jsonplaceholder.typicode.com/photos', {method: 'get'})
        .then(res => res.json())
        .then(data => {
            this.setState({ 
                images: data
            })
        })
    }
    render() {
        console.log(this.state.images)
        return (
            <div>
                <span>Photos should be here!</span>
                {this.state.images.map((item, i) => {
                    <SinglePhotoComponent title={item.title} link={item.url} key={i} />
                })}
            </div>
        )
    }
}
